import React, {useState} from 'react';
import {AuthService, signUpData} from "../services/authService";
import {useAppDispatch} from "../redux/store";

const SignUp = () => {
    const [signUpData, setSignUp] = useState<signUpData>({ userId: '', password: '', userName: '' });
    const dispatch = useAppDispatch();
    return (
        <section>
            <div>
                <input
                    type="text"
                    value={signUpData.userId}
                    onChange={(e) => setSignUp({ ...signUpData, userId: e.target.value })}
                />
                <input
                    type="text"
                    value={signUpData.password}
                    onChange={(e) => setSignUp({ ...signUpData, password: e.target.value })}
                />
                <input
                    type="text"
                    value={signUpData.userName}
                    onChange={(e) => setSignUp({ ...signUpData, userName: e.target.value })}
                />
                <button onClick={() => dispatch(AuthService.signUp(signUpData))}>Sign Up</button>
            </div>
        </section>
    );
};

export default SignUp;
